      "excerpt": "<p>   哥白尼 Sentinel-2（哨兵 2）计划是一个由两颗相同的 Sentinel-2 极轨卫星组成的星座，两颗卫星相位差 180°，运行在平均高度 786 km 的太阳同步轨道上。每颗卫星在其轨道上的位置由双频全球导航卫星系统（GNSS）接收器测量；通过专用推进系统维持轨道精度；每颗卫星配备了最先进的多光谱成像仪（Multi Spectral Instrument ，MSI），可提供高分辨率的光学成像。</p>\n",
