      "excerpt": "<p>  （时间）序列数据处理过程中往往会有缺失值（例如 9999、NaN 或其他的异常值），对这些数据的处理是下一步分析、研究和应用的基础。</p>\n<p>  本文以 2018 年 MOD09A01 地表反射率数据计算的 8 天合成 46 期 NDVI 数据为基础（已完成去云处理，有云时段的数据已赋值为 NaN，部分数据做了微调，以符合本文的内容），选取 一个样点（样点经度：123°4′0.87″，纬度：42°56′45.75″），完成时序有云数据（缺失值）的插补。</p>\n",
